import Head from 'next/head'
import '../styles/xkcd.css'


export default function Home() {
  return (
    <div className="hello">
      <h1>Hello World</h1>
      <style jsx>{`
      .hello {
        font: 15px Helvetica, Ariel, sans-serif;
        background: #eee;
        padding: 100px;
        text-align: center;
        transition: 100mx ease-in background;
      }
      .hello:hover {
        background: #ccc;
      }
      `}
      </style>
    </div>
  )
}
